import React, { Fragment } from 'react';
import "./Mobile.css";
import { motion,AnimatePresence } from "framer-motion";

function NMOBILE({handleClose}) {
    const dropIn={
        hidden:{
         x:"-100vh",
         opacity:0,
        },
        visible:{
            x:"0vh",
            opacity:1,
            transition:{
                duration:0.6,
                type:"spring",
                damping:25,
                stiffness:500,
            }
        },
       exit:{
        x:"100vh",
        opacity:0,
        },
    }
    return(
        <Fragment>
            <motion.div id='MOBILE'
            variants={dropIn}
            initial="hidden"
            animate="visible"
            exit="exit"
            >
                            <button onClick={handleClose}>ffff</button>


            </motion.div>
        </Fragment>
    );
}export default NMOBILE;
